■ウインカーポジションキット <br> 
特長<br>
●ウインカー(24v25w)の電球を変えずに、スモール点灯時にウインカーが点灯します。ウインカーが作動すると点滅となります。<br>
●配線を単純化するために、左右別々のユニットにしました。<br>
仕様<br>
本体ユニット　2個<br>
電圧　24v専用　片側50Wまで対応<br>
ユニット本体サイズ　100×22×30mm<br>
■メーカー:アイピープロジェクト<br>
